  JWYNNE-LEWIS, John and LINWOOD, Gillian Jane
  WYNNE -LEWIS, John and LINWOOD, Gillian Jane (cont...)
  avid explorer, he drove overland from Singapore to London in 1959, through the jungles of Asia and
  on via the Khyber Pass and Afghanistan to the Bosphorus. Back in New Zealand he has explored many
  tracts of bush and ancient pa sites in Northland and Hawkes Bay and has an inherent interest in the
  Maori people and their history and in their early association with the Williams and Busby families,
  an interest shared in common with his mother and with Kura Beale at Parekura Bay.
  Gillian was educated at Nga Tawa (Head of Barker House and Deputy Head Prefect) and graduated Dip
  Home Science from Otago University.
  01> WYNNE -LEWIS, Jonathan
  b 13.10.1965
  Jonathan b. at Christchurch. He was educated at Medbury Preparatory School then Christ's
  College (1979-83) where he was a school prefect and head of Corfe House. He attended Otago and
  Canterbury Universities and graduated BCom in 1987. He is currently a director of Norlake
  Trading Company in Taupo.
  02> WYNNE - LEWIS, Katherine
  b 27.06.1968
  Katharine b. at Christchurch. She attended Rangi Ruru Girls' School and graduated BA from
  Otago University in 1988. She is currently Executive Functions Coordinator with Bankers Trust
  at their head office in Sydney.
  03>'CANNING, William Busby
  b 14.06.1900 d 25.06.1901
  William b, at Hastings and d. at Pourerere.
  04> CANNING, Davis (Peter) m on 25.11.1925 to SWAN, Nancy
  b 28.01.1902 d 27.11.1981
  b ** ** **** d 23.02.1981
  Peter b. at Hastings and bd, at St Michael's and All Angels Church Cemetery, Porangahau. No children.
  Peter farmed "Oakbourne" station from 1924.
  05> CANNING, Beatrix Busby m on 26.10.1933 to DONKIN, Douglas Sydney (Pat)
  (Betty)
  b 29.01.1905
  b 15.05.1899 d 21.11.1976
  Beatrix b. at Hastings and m. at Williams Memorial Church, Paihia.
  Pat farmed "Meteor Downs" station near Springshore, Queensland, with his brother, Darcy. He retired to
  live in Bowral, NSW. During WW1 he served in the Light Horse Regiment and in WW2 he was a Major in the
  Mobile Machine Gun Regiment of the 8th Division, AIF.
  Betty was a keen horsewoman and golfer. She is now in a nursing home in Sydney.
  01> DONKIN, Patrick Canning m on 04.09.1961 to BARKER, Janet Leslie
  b 21.09.1934
  b 27.08.1939
  Patrick b. at Sydney.
  Patrick was educated at Tudor House, Mossvale and Cranbrook School, Sydney. He jackarooed at
  "Bundemar", Trangie, NSW before buying a property at Blackheath, NSW. He sold that property and
  moved to Esperance, Western Australia where he farmed for many years before moving to Perth,
  Western Australia to start his own business.
